import React from 'react'
import {Marker, Popup} from 'react-leaflet'
import {IconLocation} from './IconLocation'



const Markers = (props)=> {

    const {data} = props;

    const markers = data.map((gasolinera, i) => (
        /* console.log(gasolinera[i]) */
        <Marker key={i} position = {[gasolinera.latitud, gasolinera.longitud]} icon={IconLocation}>
            <Popup>
                <p>
                    Nombre: {gasolinera.nombre_sede} <br/>
                    
                    
                    Latitud: {gasolinera.latitud} <br/>
                    Longitud: {gasolinera.longitud} <br/>
                </p>
            </Popup>
        </Marker>
    )); 
    
    return markers;
};

export default Markers
